import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';


const NavBar = (props) => {
    return (
        <div id="nav">
              <Link id="home" to="/">Home</Link> {' '}
              <Link id="other-links" to='/products' >Products</Link> {' '}
              <Link id="other-links" to='/contact-us'>Say Hello!</Link> {' '}
            </div> 
    );
};

export default NavBar
